export default function Card({ word }) {
  return (
    <div>
      <div className="card">
        <div className="word">{word}</div>
      </div>
      <style jsx>{`
        .card {
          flex-basis: 20%;
          text-align: center;
          background: lightblue;
          padding: 20px;
          margin: 5px;
          width: 100%;
        }
        .quote {
          font-family: cursive;
          color: #e243de;
          font-size: 24px;
          padding-bottom: 10px;
        }
        .author {
          font-family: sans-serif;
          color: #559834;
          font-size: 20px;
        }
      `}</style>
    </div>
  )
}
